import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Button, TextField, Divider, Card, CardContent, Box, Grid } from '@material-ui/core';
import openSocket from 'socket.io-client';

const socket = openSocket('http://localhost:5000');

const useStyles = makeStyles((theme) => ({
	root: {
		padding: theme.spacing(1),
	},
}));

function App() {
	const classes = useStyles();

	return (
		<Card display='block'><CardContent>
			<Box display='flex' flexDirection='column' alignItems='center' width="fit-content">
				<Box m={3}>
					<form noValidate autoComplete="off">
						<TextField id="name" label="Name" variant="outlined"/>
					</form>
				</Box>

				<Grid container direction='row' justify='center' alignItems='center'>
					<Grid item xs>
						<Box alignItems="flex-end" pr={3}>
							<Button variant='contained' color='primary'>Create Game</Button>
						</Box>
					</Grid>
					<Grid item xs>
						<Box display='flex' flexDirection='column' alignSelf='center' py={3} borderLeft={1} pl={4}>
							<form noValidate autoComplete="off">
								<TextField id="gameCode" label="Game Code" variant="outlined"/>
							</form>
							<Box my={0.5}/>
							<Button variant='contained' color='primary'>Join Game</Button>
						</Box>
					</Grid>
				</Grid>
			</Box>
		</CardContent></Card>
	);
}

export default App;
